import React, { Component } from "react";
import "./Node.css";

class Node extends Component {
  render() {
    const { column, row, isStart, isFinish, isWall } = this.props;
    const extraClassName = isFinish
      ? "finish"
      : isStart
      ? "start"
      : isWall
      ? "node-wall"
      : "";
    return (
      <div id={`node-${column}-${row}`} className={`node${extraClassName}`} />
    );
  }
}
export default Node;
